import NavButton from "./NavButton";

import styles from "./navbar.module.css";

const NavBar = props => (
  <div className={styles.NavBar}>
      <logo className={styles.logo}>
          Test
      </logo>
      <div className={styles.button}>
    {props.navButtons.map(button => (
      <NavButton
        key={button.path}
        path={button.path}
        label={button.label}
        icon={button.icon}
      />
    ))}
    </div>
  </div>
);

export default NavBar;
